import React,{Component} from 'react'
import generate from '../logic/ticket-generator'

class Generator extends Component{
    render(){
        const ticket=<generate/>
        return(
            <div>
                <generate/>
                {ticket}
            </div>
        )
    }
}
export default Generator;
